import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div class = "ThisSite">
      <div class="title"><h1>愛を知らせに来た佐藤</h1></div>
      <div class="explanationOne">このゲームについて<br/></div>
      <div class="explanationTwo">舞台はとある国の中で起こる一つの小さくも、とても大きい物語。<br/>主人公はそんな世界に旅立つべく三つの中から相棒を一つ選び、旅に出る。<br/>パワー型の佐藤、バランス型の佐藤、スピード型の佐藤。<br/>その三つの中から選び、運命のピースの一つをいれる。旅に出た後主人公は、「自分とは何か」を知るためにその台地に古くから存在する四神を相棒とめぐる。<br/>極寒の雪山がある北には「パソコンクラッシャーS」、町が最も栄えている東には「コロコロ椅子での爆速ターボT」、のどかな農村部が広がる西では「ブロッコリーのY」、南国の広大なビーチがある南には「中指の使者K」がいて、<br/>それぞれの地域での異変の正体が四神の異変とつながっているということを知る。主人公は自分の目標と世界に救出を目指すべく、弱肉強食、人間賛歌、相思相愛に気づかされる冒険に繰り出す。<br/>時に生き物を狩り、時に新しい仲間と出会い、時に回り道をし、時にピンチを切り抜ける。</div>
    </div>
  );
}

export default App;
